import { useEffect, useState } from 'react'
import { Children } from '../../classes'
import { createChildrenList } from '../backend/fetchData'

import toggleOn from '../../images/person-circle-check.png'
import toggleOff from '../../images/person-circle-xmark.png'

function SwitchList() {
    const [childList, setChildList] = useState<Children[] | null>(null)

    useEffect(() => {
        createChildrenList("Sally")
            .then((dataList) => {
                setChildList(dataList)
            })
    },[])
  return (
      <div className='switch-container'>
          <p className='switch-header'>My Children</p>
          {
              childList?.map((child: Children) => (
                  <li key={child.getFirstName()}>
                      <p>{child.getFirstName()}</p>
                      {/* icon for switch */}
                      <div className='toggle'>
                          <img className='toggle-on' src={toggleOn} alt='signed in' />
                          <img className='toggle-off' src={toggleOff} alt='signed out' />
                      </div>
                  </li>
              ))
          }
      </div>
  )
}

export default SwitchList
